import React, {useState } from "react";
import Axios from 'axios'

const Restro_Signup = () => {
    const url="http://localhost:3002/restro_create";
    const [data, setData] = useState({
        rest_name:"",
        rest_email:"",
        rest_password:"",
        rest_location:""
    },);
    function handleSubmit(e){
        const newData={...data};
        newData[e.target.id]=e.target.value;
        setData(newData);
        console.log(newData);

    }
    function submit(e){
        e.preventDefault();
        Axios.post(url,{
            rest_name:data.rest_name,
            rest_email:data.rest_email,
            rest_password:data.rest_password,
            rest_location:data.rest_location,
        },).then(res=>{
            console.log(res.data);
        })

    }
    return (
        <div>
            <form onSubmit={e=>submit(e)}>
                <div>
                    <h2>Sign Up</h2>
                </div>

                <div>
                    <label htmlFor="rest_name">Restaurant Name: </label>
                    <input onChange={(e)=>handleSubmit(e)} id="rest_name" value={data.rest_name} type="text" required="required" name="name" placeholder="Enter your name"/> 
                </div>
                <br></br>
                <div>
                    <label htmlFor="rest_email">Restaurant Email: </label>
                    <input onChange={(e)=>handleSubmit(e)} id="rest_email" value={data.rest_email} type="email" required="required" name="email" placeholder="Enter your email"/>
                </div>
                <br></br>
                <div>
                    <label htmlFor="rest_password">Restaurant Password: </label>
                    <input onChange={(e)=>handleSubmit(e)} id="rest_password" value={data.rest_password} type="password" required="required" name="password" placeholder="Enter your password"/>
                </div>
                <br></br>
                <div>
                    <label htmlFor="rest_location">Restaurant Location: </label>
                    <input onChange={(e)=>handleSubmit(e)} id="rest_location" value={data.rest_location} type="text" required="required" name="password" placeholder="Enter your location"/>
                </div>
                <br></br>
                <div>
                    <button className="btn btn-primary sm m-5">submit</button>
                </div>
            </form>
            
        </div>
    )
}

export default Restro_Signup
